function newWord() {
	if (secretHistory.length === words.length) {
		return alert("you've played all the words!")
	} else {
		var bFound = false;
		while (!bFound) {
			var c = Math.floor(Math.random() * words.length);
			secret = words[c];
			if (secretHistory.indexOf(secret) === -1) {
				bFound = true;
				secretHistory.push(secret);
				wordFill = [];
				keyMisses = [];
				for (i = 0; i < secret.length; i++) {
					wordFill.push("_");
				}
			}
		}
		main();
	}
}

function lookKey(key) {
	if (playing) {
		var bFound = false;
		for (i = 0; i < keyMisses.length; i++) {
			if (keyMisses[i] === key) {
				bFound = true;
			}
		}
		if (bFound) {
			main();
		} else {
			var tempWord = [];
			var n = Math.floor((10 - secret.length) / 2) + 1;
			for (j = 0; j < secret.length; j++) {
				if (secret.charAt(j) === key) {
					tempWord.push(secret.charAt(j));
					bFound = true;
				} else {
					if (wordFill[j] === "_") {
						tempWord.push("_");
					} else {
						tempWord.push(wordFill[j]);
					}
				}
				n++;
			}
			wordFill = tempWord;
			if (wordFill.indexOf("_") === -1) {
				playing = false;
				wins++;
				gameOver("YOU WIN!");
			} else if (!bFound) {
				keyMisses.push(key);
				if (keyMisses.length < 6) {
					main();
				} else {
					playing = false;
					losses++;
					wordFill = secret.split();
					gameOver("YOU LOSE!");
				}
			} else {
				main();
			}
		}
	}
}

